import React from "react";

export default function Banner() {
  return (
    <div className="bg-[#ccfbf1] w-full py-[100px] text-center">
      <div className=" max-w-[1240px] mx-auto">
        <div className="text-0.5xl md:text-1xl font-bold">Learn with Us.</div>
        <h2 className="text-[#0f172a] text-2xl  font-bold md:text-[20px]">
          Grow with Us.
        </h2>
        <div className="text-[#0f172a] text-0.5xl  font-bold md:text-[20px]">
          Learn
        </div>
      </div>
    </div>
  );
}
